import { View, Text, Box, Button } from 'react-native'
import React from 'react'
import tw from "twrnc";
import Mapa from "../Imagenes/mapa.jpg"

export default function Principal() {
    return (
        <View style={tw`flex bg-black h-full`}>

            <View style={tw`flex-1 flex-row w-full h-full bg-purple-700 justify-center items-center`}>

                {/*FLOATING BOX*/}
                <View style={tw`self-end w-10/12 h-3/12 bg-blue-400 mb-5 rounded-3xl`}>

                </View>
            </View>

        </View>
    )
}
